import { Box } from "@mui/system";
import { useEffect } from "react";
import axios from "axios";
import { TextField } from "@mui/material";

const Autocomplete = () => {
  useEffect(() => {
    const config = {
      method: "get",
      url: "https://maps.googleapis.com/maps/api/place/autocomplete/json?input=Vict&types=geocode&language=fr&key=AIzaSyCdLmmlsKudTLknJq-f3z0Yz-YMUSrZ4LU",
      headers: {},
    };

    axios(config)
      .then(function (response) {
        console.log(JSON.stringify(response.data));
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  return (
    <Box>
      <h1>Autocomplete</h1>
      <TextField
        label="Addresse"
        variant="outlined"
        type="text"
        name="formatted_address"
        id="formatted_address"
      />
    </Box>
  );
};

export default Autocomplete;
